            lang.rt.ast = state.ast;
            lang.rt.msg = state.msg;
            lang.rt.nb_steps = state.nb_steps;
            lang.rt.display_result = state.display_result;
            lang.rt.error = state.error;
            lang.rt.cont = state.cont;
            lang.rt.ctx = state.ctx;

