CodeBootVM.prototype.execEvent = function (event) {

    var vm = this;

    vm.latestExecEvent = event;

    switch (event) {

    case 'steppause':
        vm.steppause();
        break;

    case 'animate':
        vm.animate();
        break;

    case 'eval':
        vm.eval();
        break;

    case 'stop':
        vm.stop();
        break;

    case 'reset':
        vm.reset();
        break;
    }
};

