function endsWith(str, suffix) {
    return str.indexOf(suffix, str.length - suffix.length) !== -1;
}

CodeBootVM.prototype.getStorageId = function () {

    var vm = this;

    return vm.storageId;
};

CodeBootVM.prototype.getStorage = function () {

    var vm = this;

    try {
        var storage = localStorage[vm.getStorageId()];
        if (storage)
            return storage;
        else
            return null;
    } catch (e) {
        return null;
    }
};

CodeBootVM.prototype.setStorage = function (value) {

    var vm = this;

    try {
        localStorage[vm.getStorageId()] = value;
    } catch (e) {
    }
};

CodeBootVM.prototype.clearStorage = function () {

    var vm = this;

    localStorage.removeItem(vm.getStorageId());
};

CodeBootVM.prototype.saveSession = function () {

    var vm = this;
    var state = vm.serializeState();

    vm.setStorage(JSON.stringify(state));
};

CodeBootVM.prototype.loadSession = function () {

    var vm = this;
    var state = vm.getStorage();

    if (state) {
        vm.restoreState(JSON.parse(state));
    }
};

CodeBootVM.prototype.serializeState = function () {

    var vm = this;

    var state = {
        repl: {
            history: undefined
        },
        lang: vm.lang.getId() + '-' + vm.level,
        devMode: vm.devMode,
        showLineNumbers: vm.showLineNumbers,
        largeFont: vm.largeFont,
        animationSpeed: vm.animationSpeed,
        options: vm.options
    };

    state.repl.history = vm.repl.cb.hm.serializeState();

    state.files = vm.fs.serialize();
    state.openEditors = [];
    vm.fs.forEachEditor(function (editor) {
        state.openEditors.push(editor.file.filename);
    });
    state.activeEditor = null;
    if (vm.fs.fem.activated >= 0) {
        state.activeEditor = vm.fs.fem.editors[vm.fs.fem.activated].file.filename;
    }

    return state;
};

function cb_internal_attempt(operation) {
    try {
        operation();
        return false;
    } catch (e) {
        return true;
    }
}

CodeBootVM.prototype.restoreState = function (state) {

    var vm = this;

    if (state === undefined) return;

    var failed = false;

    if (state.options) {
        cb.options = state.options;
    }

    failed = cb_internal_attempt(function () {
        vm.repl.cb.hm.restoreState(state.repl.history);
    }) || failed;

    failed = cb_internal_attempt(function () {
        vm.setLang(state.lang || 'js-novice');
        vm.setLangUI();
    }) || failed;

    failed = cb_internal_attempt(function () {
        vm.setDevMode(!!state.devMode);
    }) || failed;

    failed = cb_internal_attempt(function () {
        vm.setShowLineNumbers(!!state.showLineNumbers);
    }) || failed;

    failed = cb_internal_attempt(function () {
        vm.setLargeFont(!!state.largeFont);
    }) || failed;

    failed = cb_internal_attempt(function () {
        vm.setAnimationSpeed(state.animationSpeed);
    }) || failed;

    if (state.files) {
        failed = cb_internal_attempt(function () {
            vm.fs.restore(state.files);
            vm.fs.rebuildFileMenu();
        }) || failed;
    }

    if (state.openEditors) {
        failed = cb_internal_attempt(function () {
            state.openEditors.forEach(function (filename) {
                vm.fs.openFile(filename);
            });
        }) || failed;
    }

    if (state.activeEditor) {
        failed = cb_internal_attempt(function () {
            var file = vm.fs._asFile(state.activeEditor);
            file.fe.activate();
        }) || failed;
    }

    if (failed) {
        vm.reportError('Failed to restore state');
    }
};

function cb_tutorial() {
    if (cb.inTutorial) return;
    cb.inTutorial = true;
    cb_tutorial1();
}

function cb_tutorial_setREPLExpression() {
    cb.stop();
    cb.query('replay=1+2*3');
    cb.handle_query();
    cb.focusREPL();
}

function cb_tutorial1() {
    $('#cb-repl').popover({
	animation: true,
	placement: 'bottom',
	trigger: 'manual',
	title: 'Console',
	content:
            '<p>This is the Console.  After the prompt, enter the JavaScript code you wish to execute.</p> ' +
	    '<p><a class="btn btn-primary" onclick="cb_tutorial_setREPLExpression();">Show me</a> ' +
	    '<a class="btn btn-primary" onclick="cb_tutorial2();">Next</a></p>',
	html: true,
    });

    $('#cb-repl').popover('show');
    cb.focusREPL();
}

function cb_tutorial2() {
    $('#cb-repl').popover('destroy');
    $('#play-button').popover({
	animation: true,
	placement: 'bottom',
	trigger: 'manual',
	title: 'Play button',
	content:
            '<p>Use this button to evaluate the code entered at the Console, or simply press the Enter key.</p>' +
	    '<p><a class="btn btn-primary" onclick="cb_tutorial_setREPLExpression();' + "setTimeout(function () { $('#play-button').click(); }, 100);" + '">Show me</a> ' +
	    '<a class="btn btn-primary" onclick="cb_tutorial3();">Next</a></p>',
	html: true,
    });

    $('#play-button').popover('show');
    cb.focusREPL();
}

function cb_tutorial3() {
    $('#play-button').popover('destroy');
    $('#step-button').popover({
	animation: true,
	placement: 'bottom',
	trigger: 'manual',
	title: 'Step button',
	content:
            '<p>Use this button to execute one step of the code.</p>' +
	    '<p><a class="btn btn-primary" onclick="cb_tutorial_setREPLExpression();' + "setTimeout(function () { $('#step-button').click(); }, 100); cb_tutorial4();" + '">Show me</a>  ' +
	    '<a class="btn btn-primary" onclick="cb_tutorial_end();">Done</a></p>',
	html: true,
    });

    $('#step-button').popover('show');
    cb.focusREPL();
}

function cb_tutorial4() {
    $('#step-button').popover('destroy');
    $('#step-button').popover({
	animation: false,
	placement: 'bottom',
	trigger: 'manual',
	title: 'Step button',
	content:
            '<p>Press the button again to execute the next step. Repeat until the code is fully evaluated, or press the Play button.</p>' +
	    '<p><a class="btn btn-primary" onclick="cb_tutorial_end();">Done</a></p>',
	html: true,
    });

    $('#step-button').popover('show');
    cb.focusREPL();
}

function cb_tutorial_end() {
    $('#step-button').popover('destroy');
    cb.focusREPL();
    cb.inTutorial = false;
}

(function ($) {
    function getElementBounds($element) {
        var offset = $element.offset();
        return {
            left: offset.left,
            top: offset.top,
            right: offset.left + $element.width(),
            bottom: offset.top + $element.height()
        };
    }

    function overlap(b1, b2) {
        if (b1.right < b2.left) return false;
        if (b1.left > b2.right) return false;
        if (b1.top > b2.bottom) return false;
        if (b1.bottom < b2.top) return false;

        return true;
    }

    $.fn.getBounds = function () {
        return getElementBounds(this);
    };

    $.fn.isInView = function($container) {
        if (!$container) $container = $("body");
        var $child = this;

        if (!$child.is(":visible")) {
            return false;
        }

        var $parent = $child.parent();
        while (true) {
            if (!$parent) break;

            var cBounds = getElementBounds($child);
            var pBounds = getElementBounds($parent);
            if (!overlap(cBounds, pBounds)) {
                return false;
            }

            if ($parent.get(0) === $container.get(0)) break;

            $parent = $parent.parent();
        }

        return true;
    };
})(jQuery);

